import { Component } from "react";


export default class PostComp extends Component
{
    render()
    {
        return(<div id="todo-container" style={{border:"1.5px solid black",width:"350px",margin:"5px",padding:"6px"}}>
            <div >
                <span className="todo-header-title">Title:</span>{this.props.post.title}
            </div>
            <div className="todo-header-title">
                Body:
            </div>
            {this.props.post.body}
        </div>)
    }
}
